VALUES ('3267180361308', 'Queues de langoustine', 'langoustine (crustacés) (Nephrops norvegicus), antioxydant : disulfite de sodium (E223) (sulfites). Élaboré dans un atelier qui utilise : poissons et mollusques. Mise en oeuvre : Laisser décongeler à température entre 0 et 40C. Idée recette : Langoustine à la Provençale - Durée 20 min. env. Ingrédients : 800g de queues de langoustines, un litre de court-bouillon, deux tomates fraîches, une gousse d\'ail, un bouquet de persil. Plongez les queues de langoustines surgelées dans un court-bouillon chaud et laissez cuire environ une dizaine de minutes. Pendant ce temps coupez les tomates e petits cubes et écrasez la gousse d\'ail. Sortez les langoustines et enlevez la carapace. Réservez. Faites chauffer dans une poêle anti-adhésive de l\'huile d\'olive. Ajoute les queues de langoustines décortiquées, l\'ail et la tomate concassées. Laissez cuire six minutes environ. Servez accompagné de quelques tagliatelles au beurre.', '', '0.6', '0.24', '0.4', '0.3', '', '16.8', '0.25', '0.0984251968503937', '', '1');

